        display: flex;
        align-items: center;
        justify-content: space-between;
        padding: 0 20px;
        z-index: 999;
      }
      .nav-logo {
        color: #6c63ff;
        font-size: 18px;
        font-weight: 600;
        text-decoration: none;
      }
      .nav-menu {
        display: flex;
        gap: 24px;
      }
      .nav-menu a {
        color: #555;
        text-decoration: none;
        font-size: 14px;
        padding: 8px 0;
        position: relative;
        transition: color 0.2s;
      }
      .nav-menu a::after {
        content: '';
        position: absolute;
        bottom: 0;
        left: 0;
        width: 0;
        height: 2px;
        background: #6c63ff;
        transition: width 0.2s;
      }
      .nav-menu a:hover {
        color: #6c63ff;
      }
      .nav-menu a:hover::after {
        width: 100%;
      }
      .nav-menu a.active {
        color: #6c63ff;
      }
      .nav-menu a.active::after {
        width: 100%;
      }
      .logo {
        width: 90px;
        height: 90px;
        border-radius: 50%;
        background: #6c63ff;
        display: flex;
        align-items: center;
        justify-content: center;
        color: white;
        font-size: 36px;
        font-weight: 500;
      }
      .nav {
        display: flex;
        gap: 20px;
        flex-wrap: wrap;
        justify-content: center;
      }
      .nav a {
        color: #6c63ff;
        text-decoration: none;
        padding: 10px 20px;
        border: 1px solid #6c63ff;
        border-radius: 6px;
        transition: all 0.2s ease;
      }
      .nav a:hover {
        background: #6c63ff;
        color: white;
      }
    </style>
